import React, { Component } from 'react';
import { TopNav, Menu, FlexContainer } from './components';
import Map from './map';
import { categoryList } from './map.js';

class App extends Component {
	constructor(props){
		super(props);
	}

  render() {
    return (
      <div >
        <TopNav />
        <FlexContainer
        	children={[<Menu categoryList={categoryList}/>,
        	<Map />]} />

      </div>
    );
  }
}

export default App;

